import React from 'react';
import classes from './Toolbar.module.css';
import {Link} from 'react-router-dom';


const toolbar = props => {
    let content = (
        <div className={classes.Toolbar}>
            <strong>{props.title}</strong>
            <br/>
        </div>
    );
    if (props.back){
        content = (
            <div className={classes.Toolbar}>
                <strong>{props.title}</strong>

                <nav>
                    <ul>
                        <li><Link to='/' exact>Back</Link></li>
                    </ul>
                </nav>
            </div>
        );
    }
    return content;

};

export default toolbar;
